patch:
diff --git a/clang/lib/AST/ASTContext.cpp b/clang/lib/AST/ASTContext.cpp
index bf24704e48ea..b9944f722530 100644
--- a/clang/lib/AST/ASTContext.cpp
+++ b/clang/lib/AST/ASTContext.cpp
@@ -6590,7 +6590,17 @@ QualType ASTContext::getDeducedTemplateSpecializationTypeInternal(
                                         Canon);
   llvm::FoldingSetNodeID TempID;
   DTST->Profile(TempID);
-  assert(ID == TempID && "ID does not match");
+  if (ID != TempID) {
+    // Fall back to undeduced canonical form if the profile mismatches:
+    // This ensures we do not return a null type, preserving downstream assumptions.
+    if (!DeducedType.isNull()) {
+      return getDeducedTemplateSpecializationTypeInternal(
+          Template, QualType(), IsDependent, QualType());
+    }
+    // If already undeduced, just fail hard as this would then be infinite recursion.
+    assert(false && "Deduced template specialization type profile mismatch!");
+    return QualType();
+  }
   Types.push_back(DTST);
   DeducedTemplateSpecializationTypes.InsertNode(DTST, InsertPos);
   return QualType(DTST, 0);
